-- DWDATE

drop table DWDATE cascade constraints;

CREATE TABLE	DWDATE
	(	DateKey INTeger primary key, 
		Datevalue DATE,
		DayOfMonth number(2), -- Field will hold day number of Month
		DaySuffix VARCHAR2(2), -- Apply suffix as 1st, 2nd ,3rd etc
		DayName VARCHAR2(9), -- Contains name of the day, Sunday, Monday 
		dayshortname varchar2(3), -- day shoort name eg Mon, Tue
    DayOfWeek number(1),-- First Day Sunday=1 and Saturday=7
		DayOfQuarter number(2),
		DayOfYear number(3),
		WeekOfYear number(2),--Week Number of the Year
		MonthOfYear number(2), --Number of the Month 1 to 12
		Monthname Varchar2(9),--January, February etc
		monthshortname varchar2(3), -- Jan feb, mar etc
    MonthOfQuarter number(1),-- Month Number belongs to Quarter
		Quarter number(1),
		QuarterName VARCHAR2(6),--First,Second..
		Year number(4),-- Year value of Date stored in Row
		FirstDayOfMonth DATE,
		LastDayOfMonth DATE,
		firstdayofquarter date,
		lastdayofquarter date,
		FirstDayOfYear DATE,
		LastDayOfYear DATE,
		IsWeekday NUMBER(1)-- 0=Week End ,1=Week Day
	);



